import HomePage from "./Pages/Home/HomePage";
import { BrowserRouter, Routes, Route } from "react-router";


function App() {
  return (
    <div>

      <BrowserRouter>
        <Routes>
          <Route index element={<HomePage />}/>
        </Routes>
    </BrowserRouter>
    </div>
  )
}

export default App;
